import React from 'react'

const Navbar = ({filerValue,navBtn}) => {
    return (
        <>
            <div className="navigation">
      <div className="nav-btn-group">
      {
          navBtn.map((crnEltm) =>{
              return(
                  <>
        <button className="navbtn" onClick={()=> filerValue(crnEltm)}>{crnEltm}</button>

                  </>
              )
          })
      }
        
    
      </div>
    </div>
        </>
    )
}

export default Navbar
